import React from "react";
import Logo from './components/Logo';

function App(){
  return (
      <>
      <div className="row">
      <div className="col-4">
         <Logo/>
      </div>
      <div className="col-8">
         <div className="row">
           <div className="container_">
           <p className="head">Welcome</p>
           <p className="head">Pablo Nicolus</p>
           </div>
         </div>
      </div>
      </div>
      </>
  );
}

export default App;
